import Notices from '../Notices/index';
import Newsletter from '../Newsletter/index';
import Posts from '../Posts/index';
import { Container } from './styles';

const Main = () => (
  <Container>
    <Notices />
    <Posts />
    <Newsletter />
  </Container>
);

export default Main;
